import React from 'react'

const Message = props => {
  return (
    <div>
      <p>
        {props.message.message} <span>create Report</span>
      </p>
    </div>
  )
}
const Messages = props => {
  const data = props.messages.map((message, index) => (
    <Message key={index} message={message} />
  ))
  return <div>{data}</div>
}
export default Messages
